import './App.css';
import {Logo} from './Utils/ImportFile';
import React from 'react';

function App() {
  React.useEffect(()=>{
    setTimeout(()=>{
      document.getElementsByClassName('logoContainer')[0].setAttribute('style','display:none')
    },1100)
  })
  return (
     <>
     <Logo />
     </>
  );
}

export default App;
